(1, 'Blog pages header', '<div class="section " style="background: #3a94d8;">\r\n<div class="wrapper">\r\n<div class="title-holder">\r\n<h3><span>Please read our</span> Latest Posts</h3>\r\n<hr />\r\n<p>Occasion Pros</p>\r\n</div>\r\n</div>\r\n</div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-11-19 16:58:57'),
(2, 'About Us header', '<div class="section about-holder">\r\n			<div class="title-holder">\r\n				<h3>\r\n					<span>Who we are!</span>\r\n					ABOUT US\r\n				</h3>\r\n				<hr>\r\n			</div>\r\n			<div class="content-holder">\r\n				<h5>Occasion Pros is your one-stop site for connecting clients with the <br> best and talented event professionals in the United States.</h5>\r\n				<p>OP has the ease and convenience to matched the quality and <br> reputation you receive when using an event planner.</p>\r\n			</div>\r\n		</div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-07-06 15:04:37'),
(3, 'About Us content 1', '<div class="about-section cont1 clearfix" style="background:url(''/frontsite/images/about-img.jpg'');">	<div class="container  half-width f-left">		<div class="content-holder center-div">			<h3>				<span>All Professionals </span>				on <color style="color:#ffa928">Occasion ProS</color></h3>			<p>are vetted and all events are confirmed by phone and email!</p>		</div>	</div>	<div class="container half-width f-right">		<div class="img-holder hori-div">			<img src="/frontsite/images/about1.png" alt="">		</div>	</div></div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-07-06 15:19:09'),
(4, 'About Us content 2', '<div class="about-section cont2 clearfix">\r\n			<div class="container half-width f-left">\r\n				<div class="img-holder">\r\n					<img src="/frontsite/images/about2.png" alt="">\r\n				</div>\r\n			</div>\r\n			<div class="container half-width f-right">\r\n				<div class="content-holder center-div">\r\n					<h3>\r\n						<span>Browse</span>\r\n					Conveniently\r\n					</h3>\r\n					<p>Conveniently browse our database of top talent <br> then book them safely to ensure your event is a <br> roaring success that your family and friends will <br> talk about for years to come.   Read verified client <br> reviews to get a better scope of who to hire for <br> your event or celebration.</p>\r\n				</div>\r\n			</div>\r\n		</div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-06-25 13:00:13'),
(5, 'About Us content 3', '<div class="about-section cont3 clearfix" style="background:url(''/frontsite/images/about2-img.jpg'');">\r\n			<div class="container  half-width f-left">\r\n				<div class="content-holder center-div">\r\n					<h3>\r\n						<span>110%</span>\r\n						satisfaction\r\n					</h3>\r\n					<p>\r\n						Whether you’re planning your first or 100th event, we’re <br> committed to matching you with the event professional <br> that suits your vision and budget. We strive on 110% <br> satisfaction from our clients and occasion professionals.\r\n					</p>\r\n				</div>\r\n			</div>\r\n			<div class="container half-width f-right">\r\n				<div class="img-holder hori-div">\r\n					<img src="/frontsite/images/about3.png" alt="">\r\n				</div>\r\n			</div>\r\n		</div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-06-25 13:00:13'),
(6, 'How it works content 1', '<div class="hiw-page"><div class="section banner-holder clearfix" style="background: #f4f4f4;">			<div class="wrapper">				<div class="f-left half-width">					<div class="title-holder middle-div">						<h4>							<span>How</span>							it works						</h4>						<hr>						<p>Occasion Pros is a simple concept.<br>							Here’s how it works:</p>					</div>				</div>				<div class="f-right half-width">					<div class="img-holder hori-div">						<img src="/frontsite/images/how-img.png" alt="">					</div>				</div>			</div>		</div></div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-06-25 19:02:08'),
(7, 'How it works content 2', '<div class="hiw-page">\r\n<div class="how-section odd clearfix box" style="background: #3a94d8;">\r\n<div class="wrapper">\r\n<div class="img-holder box half-width left-content f-left"><img src="../../../../storage/uploads/html_modules/7/2d960d2c6ed0dbfce0f8c9546e40b606.png" alt="" width="540" height="313" /></div>\r\n<div class="content-holder box half-width right-content f-right">\r\n<div class="clearfix"><label class="f-left" style="color: #214764;" for="">1</label>\r\n<h3 class="f-left">Get <br /> free <br /> quotes</h3>\r\n</div>\r\n<h4>Or search the site for <br /> Occasion Pros</h4>\r\n<p>With thousands of talented and vetted event professionals on Occasion Pros, you&rsquo;re bound to find an entertainer or service to take your event to another level. Submit your request free of charge and receive bids from our talented event professionals or search our database to connect to as many professionals as you like. An event professional will send you a price quote or message you to work out the details.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-08-12 19:08:39'),
(8, 'How it works content 3', '<div class="hiw-page">\r\n<div class="how-section clearfix box" style="background: #4d4e89;">\r\n<div class="wrapper">\r\n<div class="content-holder box half-width left-content f-left">\r\n<div class="clearfix"><label class="f-left" style="color: #252541;" for="">2</label>\r\n<h3 class="f-left">Book <br /> Online <br /> Confidently</h3>\r\n</div>\r\n<p>If everything looks good with your quote, you&rsquo;re ready to book. Just enter your payment and that&rsquo;s it&hellip; you&rsquo;re done! We&rsquo;ve designed it all to be super easy, iron-clad secure, and lightning fast. You do not pay a fee to Occasion Pros. All you pay is the amount you have agreed to with the vendor.</p>\r\n</div>\r\n<div class="img-holder box half-width left-content f-right"><img src="../../../../storage/uploads/html_modules/8/d68ca59da438171a75a1fbeea5d5e77c.png" alt="" width="540" height="313" /></div>\r\n</div>\r\n</div>\r\n</div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-08-05 02:26:57'),
(9, 'How it works content 4', '<div class="hiw-page">\r\n<div class="how-section odd clearfix box" style="background: #eca944;">\r\n<div class="wrapper">\r\n<div class="img-holder box half-width left-content f-left"><img src="../../../../storage/uploads/html_modules/9/61e2e45e796ab5a106933057b96455da.png" alt="" width="540" height="313" /></div>\r\n<div class="content-holder box half-width right-content f-right">\r\n<div class="clearfix"><label class="f-left" style="color: #82602c;" for="">3</label>\r\n<h3 class="f-left">Enjoy <br /> Your <br /> Events</h3>\r\n</div>\r\n<p>Congratulations and great job on your decision to create a meaningful event by booking top-notch talent. Your guests will appreciate the awesomeness that only quality entertainment and Occasion Pros can provide!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-08-12 19:09:41'),
