(11, 'Home About us section', '<div class="about-holder section">\r\n			<div class="title-holder">\r\n				<h3>\r\n					<span>Who we are!</span>\r\n					ABOUT US\r\n				</h3>\r\n				<hr>\r\n			</div>\r\n			<div class="content-holder">\r\n				<h5>Occasion Pros is your one-stop site for connecting clients with the <br> best and talented event professionals in the United States.</h5>\r\n				<p>OP has the ease and convenience to matched the quality and <br> reputation you receive when using an event planner.</p>\r\n				<a href="/about-us" class="trans-btn">READ MORE</a>\r\n			</div>\r\n		</div>', NULL, '1', NULL, '2017-06-25 11:15:23', '2017-07-06 15:09:47'),
(12, 'Home Top Section', '<div class="banner-holder home-over bg fullscreen" style="background-image: url(''../../../../frontsite/images/banner.jpg'');" data-img-width="1440" data-img-height="736">\r\n<div class="wrapper">\r\n<div class="content-holder center-div">\r\n<div class="title-holder">\r\n<h3><span>Connecting People</span>with the best <br /> event professionals <br /> in the world.</h3>\r\n<hr /></div>\r\n<div class="links-holder">\r\n<div class="hex-slide-res in-active">\r\n<ul class="slides">\r\n<li>\r\n<div class="hexagon-holder">\r\n<div class="hexagon center-div">&nbsp;</div>\r\n<div class="text-holder center-div">\r\n<h2>Post</h2>\r\n<p class="light-blue">YOUR</p>\r\n<p class="dark-blue">EVENT</p>\r\n<a href="../../../../events/create"><img src="../../../../frontsite/images/banner-btn.png" alt="" /></a> <label for="">It&rsquo;s FREE! Get quotes <br /> now from OPs!</label></div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class="hexagon-holder">\r\n<div class="hexagon center-div">&nbsp;</div>\r\n<div class="text-holder center-div">\r\n<h2>Search</h2>\r\n<p class="light-blue">FIND</p>\r\n<p class="dark-blue">TALENT</p>\r\n<a href="../../../../clients/search/options"><img src="../../../../frontsite/images/banner-btn.png" alt="" /></a> <label for="">Search our database &amp; <br />connect with OPs NOW!</label></div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class="hexagon-holder">\r\n<div class="hexagon center-div">&nbsp;</div>\r\n<div class="text-holder center-div">\r\n<h2>Register</h2>\r\n<p class="light-blue">PRO</p>\r\n<p class="dark-blue">SIGN-UP</p>\r\n<a href="../../../../sign-up"><img src="../../../../frontsite/images/banner-btn.png" alt="" /></a> <label for="">Sign-Up Now &amp; Get Bronze <br /> Package for 2 Months FREE!</label></div>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="scroll"><a href="#how-toggle"><img src="../../../../frontsite/images/scroll-down.png" alt="" /></a></div>\r\n</div>\r\n</div>', NULL, '1', NULL, '2017-06-2